export default class SwapiService {
    _apiBase = 'https://swapi.co/api/people/1/';
    
  getResourse = async (url) => {
    const res = await fetch(`${this._apiBase}${url}`);
    return res.json();
  };
}
getAllPeople= async() => {
let res = await fetch(this.getResourse('/people/'));

}
